// SudokuBoard.js
import React, { Component } from "react";
import SudokuCell from "./SudokuCellComponent";
import axios from "axios";

class SudokuBoard extends Component {
    state = {details: [], board: [], }

    constructor(props) {
        super(props);

        let data;
        axios.get('http://localhost:8000')
            .then(res => {
                data = res.data;
                this.setState({
                    details: data
                });
            })

        //this.state = {
            //board: [
                //[5, 3, "", "", 7, "", "", "", ""],
                //[6, "", "", 1, 9, 5, "", "", ""],
                //["", 9, 8, "", "", "", "", 6, ""],
                //[8, "", "", "", 6, "", "", "", 3],
                //[4, "", "", 8, "", 3, "", "", 1],
                //[7, "", "", "", 2, "", "", "", 6],
                //["", 6, "", "", "", "", 2, 8, ""],
                //["", "", "", 4, 1, 9, "", "", 5],
                //["", "", "", "", 8, "", "", 7, 9],
            //],
        //};

            .catch(err => {
                "Error mounting data"
            })
    }

    handleCellChange = (row, col, value) => {
        const newBoard = [...this.state.board];
        newBoard[row][col] = value;
        this.setState({ board: newBoard });
    };

    render() {
        let row1, row2, row3, row4, row5, row6, row7, row8, row9;

        return (
            <div className="sudoku-board">
                for output in this.state.details:
                    row1 = {output.row1};
                    row2 = {output.row2}
                    row3 = {output.row3}
                    row4 = {output.row4}
                    row5 = {output.row5}
                    row6 = {output.row6}
                    row7 = {output.row7}
                    row8 = {output.row8}
                    row9 = {output.row9}

                    <div key={1} className="sudoku-row">
                        {row1.map((cell, colIndex) => (
                            <SudokuCell
                                key={colIndex}
                                value={cell}
                                onChange={(value) =>
                                    this.handleCellChange(rowIndex, colIndex, value)
                                }
                            />
                        ))}
                    </div>

                <div key={2} className="sudoku-row">
                    {row2.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={3} className="sudoku-row">
                    {row3.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={4} className="sudoku-row">
                    {row4.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={5} className="sudoku-row">
                    {row5.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={6} className="sudoku-row">
                    {row6.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={1} className="sudoku-row">
                    {row1.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={1} className="sudoku-row">
                    {row1.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>

                <div key={1} className="sudoku-row">
                    {row1.map((cell, colIndex) => (
                        <SudokuCell
                            key={colIndex}
                            value={cell}
                            onChange={(value) =>
                                this.handleCellChange(rowIndex, colIndex, value)
                            }
                        />
                    ))}
                </div>
            </div>
        );
    }
}

export default SudokuBoard;
